import React from "react";
import StudentSidebar from "./StudentSidebar";
import { Link } from 'react-router-dom';
import EventItem from "./EventItem";

function EventsStudent() {
  return (
    <>
      <StudentSidebar />
      <div
        style={{
          paddingTop: "100px",
          paddingLeft: "30%",
          height: "100%",
        }}
      >
       <Link to="/EventRegistrationForm"><EventItem /></Link> 
        <EventItem />
        <EventItem />
        <EventItem />
      </div>
    </>
  );
}

export default EventsStudent;
